import React from "react";
import logo from "../../assets/logo.svg"; 
import styles from "./Logo.module.css"; 

const Logo = () => {
    return (
        <div className={styles.logoContainer}>
            <img src={logo} alt="Health App Logo" className={styles.logo} />
        </div>
    );
};

export default Logo;
